import React from 'react';
import { NavLink } from 'react-router-dom';
import styles from './Header.module.css';

const Header = () => {
  return (
    <nav className={styles.header}>
      <ul>
        <li>
          <NavLink to="/" end>
            Produtos
          </NavLink>
        </li>
        <li>
          <NavLink to="contato" end>
            Contato
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default Header;
